import React from 'react';
import { NavLink } from 'react-router-dom';


const Card = (props) =>{
    const url = `api.openweathermap.org/data/2.5/weather?q={city name}&appid=6bcb87e868aec276a7232dea5006ce49`;
    
    return(
        <>
        <div className="col-md-4 col-10 mx-auto ">
            <div className="card" >
                <div className="inputData">
                    <input type="search" name="serach" value="city" onChange={InputEvent}>
                    </input>

                </div>
                    
            </div>                            
        </div>
        </>
       
    );
}

export default Card;
